import React from "react";

const Home = (props) => {

  return (
    <div className="container home">
      <h1 className="headline-big ">we are samasthi foundation</h1>
      <p className="intro">A not-for-profit social cause organization started for two main reasons. First, to transition farmers to Sustainable Organic Farming and second, to increase the overall livelihood of farmers.</p>
    </div>
  );
};

export default Home;
